import { Switch } from "react-router-dom";
import Home from "../Components/Home";
import { Route } from "react-router-dom";
import React from "react";
const PageContent = () => {
  return (
    // Page Componentleri
    <div className="page-content">
      <Switch>
        <Route path="/home" exact>
          <Home />
        </Route>
      </Switch>
    </div>
  );
};

export default PageContent;
